char encryp[] = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+-";
int decryp[128];
int Acomp[sz], B[5] = {1};

const long M = 1e9+7;


int fan(int x) {
	int st = 5*x, sum = 0;
	for(int i = 0; i < 5; ++i) sum += decryp[An1000[st + i]] * B[i];
	return sum;
}

int f2(int x, int v) {
	int st = 9*x, sum = 0;
	if(v) st += 5;
	if(v) for(int i = 0; i < 4; ++i) sum += decryp[rmqsrt[st + i]] * B[i];
	else for(int i = 0; i < 5; ++i) sum += decryp[rmqsrt[st + i]] * B[i];
	return sum;
}

long pw(long a, long b) {
	a %= M;
	long ret = 1;
	for(; b; b >>= 1) {
		if(b & 1) {
			ret *= a;
			ret %= M;
		}
		a *= a;
		a %= M;
	}
	return ret;
}

void compute(int block) {
	Acomp[0] = fan(block);
	for(int loop = 1; loop < sz; ++loop) {
		long sum = 0;
		int i = block * sz + loop + 1;
		for(int j = 1; j <= 987; ++j) {
			sum += pw(i + j*654 + 321, abs(i-j));
			sum %= M;
		}
		sum *= i;
		sum %= M;
		Acomp[loop] = (Acomp[loop-1] + sum) % M;
	}
}

int main() {
	#ifdef INPUT
	freopen("r", "r", stdin);
	#endif
	for(int i = 0; i < 64; ++i) decryp[encryp[i]] = i;
	for(int i = 1; i < 5; ++i) B[i] = B[i-1] * 64;
	int q; scanf("%d", &q);
	while(q--) {
		int a, b;
		scanf("%d %d", &a, &b);
		a--, b--;
		int c1 = a / sz, c2 = b / sz;
		a %= sz, b %= sz;
		int mn = M, idx;
		if(c1 == c2) {
			compute(c1);
			for(int i = a; i <= b; ++i) {
				if(mn > Acomp[i]) {
					mn = Acomp[i];
					idx = c1 * sz + i + 1;
				}
			}
		} else {
			compute(c1);
			for(int i = a; i < sz; ++i) {
				if(mn > Acomp[i]) {
					mn = Acomp[i];
					idx = c1 * sz + i + 1;
				}
			}
			for(int i = c1 + 1; i < c2; ++i) {
				if(mn > f2(i,0)) {
					mn = f2(i,0);
					idx = f2(i,1);
				}
			}
			compute(c2);
			for(int i = 0; i <= b; ++i) {
				if(mn > Acomp[i]) {
					mn = Acomp[i];
					idx = c2 * sz + i + 1;
				}
			}
		}
		printf("%d\n", idx);
	}
}
